async function sendrecv(){ 
    const streams = await getSplitStream();
    for(let stream of streams) {
      const pc = new RTCPeerConnection();
      stream.getTracks().forEach(track => pc.addTrack(track, stream))
      const offer = await pc.createOffer();
      await pc.setLocalDescription(offer);
      await recv(pc);
    }
  }
  async function getSplitStream(){ 
    const element = document.getElementById("sendaudio");
    const audioCtx = new(window.AudioContext || window.webkitAudioContext);
    const source = audioCtx.createMediaElementSource(element);
    const destinationL = audioCtx.createMediaStreamDestination();
    const destinationR = audioCtx.createMediaStreamDestination();
    const splitter = audioCtx.createChannelSplitter(2);
    source.connect(splitter);
    splitter.connect(destinationL, 0);
    splitter.connect(destinationR, 1);
    await element.play();
    return [destinationL.stream, destinationR.stream];
  }
  async function recv(sender){
    const pc = new RTCPeerConnection();
    pc.ontrack = (e)=> {
      if(e.track.kind==='audio'){
        if(!window.audioTracks) window.audioTracks=[];
        audioTracks.push(e.track); // これをもっていく https://knowledge.sakura.ad.jp/26572/
        if(audioTracks.length>=2){
          document.getElementById("recvaudio").srcObject = getMergeStream(audioTracks);
        }
      }
    };
    pc.onicecandidate = (e) => {
      if(e.candidate){sender.addIceCandidate(e.candidate);}
    };
    await pc.setRemoteDescription(sender.localDescription);
    const answer = await pc.createAnswer();
    await pc.setLocalDescription(answer);
    await sender.setRemoteDescription(answer);
  }
  function getMergeStream(tracks){ // これも丸ごともっていく https://knowledge.sakura.ad.jp/26572/
    const audioCtx = new(window.AudioContext || window.webkitAudioContext);
    const dest = audioCtx.createMediaStreamDestination();
    const merger = audioCtx.createChannelMerger(tracks.length);
    tracks.forEach((track, index) => {
      const stream = new MediaStream([track]);
      const mutedAudio = new Audio();
      mutedAudio.muted = true;
      mutedAudio.srcObject = stream;
      mutedAudio.play();
      const source = audioCtx.createMediaStreamSource(stream);
      source.connect(merger, 0, index);
    })
    merger.connect(dest);
    return dest.stream;
  }
  const audiodatab64 = "";
  document.getElementById("sendaudio").src="data:audio/mp3;base64,"+audiodatab64;